CREATE TABLE IF NOT EXISTS "testpas_emailcontent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject" varchar(255) NOT NULL, "body" text NOT NULL);
CREATE TABLE IF NOT EXISTS "testpas_emailtemplate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "subject" varchar(255) NOT NULL, "body" text NOT NULL);
