CREATE TABLE IF NOT EXISTS "testpas_participantentry" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "participant_id" varchar(100) NOT NULL, "entry_date" datetime NOT NULL, "email" varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS "testpas_survey" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "description" text NOT NULL, "created_at" datetime NOT NULL);
