CREATE TABLE IF NOT EXISTS "testpas_token" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" varchar(255) NOT NULL UNIQUE, "created_at" datetime NOT NULL, "used" bool NOT NULL, "recipient_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "testpas_response" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "answer" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "question_id" bigint NOT NULL REFERENCES "testpas_question" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
