INSERT INTO testpas_emailtemplate VALUES(1,'wave1_code_entry','Physical Activity Monitoring Tomorrow (Wave 1)',replace('Hi {username},\n\nYou have successfully entered the access code for physical activity monitoring. Thank you!\n\nPlease start wearing the monitor tomorrow ({start_date}) for seven consecutive days until {end_date}.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(2,'wave1_survey_return','Survey by Today & Return Monitor (Wave 1)',replace('Dear {participant_id},\n\nPlease complete a short survey and return the monitor by today.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(3,'wave1_missing_code','Missing Code Entry (Wave 1)',replace('Hi {username},\n\nWe noticed you haven''t entered your Wave 1 code. Please do so by today if you haven''t.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(4,'intervention_access_later','Intervention Access Later',replace('Dear {participant_id},\n\nYou have been assigned to Group 0. You will receive intervention access later.\n{login_link}\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(5,'intervention_access_immediate','Intervention Access Immediately',replace('Dear {participant_id},\n\nYou have been assigned to Group 1. You now have immediate access to the intervention.\n{login_link}\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(6,'wave2_survey_ready','Wave 2 Online Survey Set – Ready',replace('Dear {participant_id},\n\nYour Wave 2 online survey is now available. Please complete it soon.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(7,'wave2_no_monitoring','No Wave 2 Physical Activity Monitoring',replace('Dear {participant_id},\n\nThere is no physical activity monitoring for Wave 2. Just complete the survey.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(8,'wave3_survey_ready','Wave 3 Online Survey Set – Ready',replace('Dear {participant_id},\n\nYour Wave 3 online survey is now available. Please complete it soon.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(9,'wave3_monitoring_ready','Wave 3 Physical Activity Monitoring – Ready',replace('Dear {participant_id},\n\nIt’s time for the final monitoring period. Please wear the device for 7 days.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(10,'wave3_code_entry','Physical Activity Monitoring Tomorrow (Wave 3)',replace('Dear {participant_id},\n\nStarting tomorrow ({start_date}), please wear the device for 7 days until ({end_date}).\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(11,'study_end','PAS 2.0 Study Concluded',replace('Dear {participant_id},\n\nThank you for participating in the PAS 2.0 study. The study has now concluded.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(12,'wave3_missing_code','Missing Code Entry (Study End)',replace('Dear {participant_id},\n\nYou missed the Wave 3 code entry. No further action is required.\n{login_link}\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(13,'account_confirmation','Confirm Your PAS 2.0 Account',replace('Dear {participant_id},\n\nPlease confirm your email by clicking the following link:\n{confirmation_link}\n\nThank you,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(14,'wave1_survey_ready','Wave 1 Online Survey Set – Ready',replace('Hi {username},\n\nCongratulations! You are now enrolled as a participant in the study.\n\nYour next task is to complete the Wave 1 Online Survey Set within 10 days. Instructions will follow soon.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
INSERT INTO testpas_emailtemplate VALUES(15,'wave3_survey_monitor_return','Survey by Today & Return Monitor (Study End)',replace('Dear {participant_id},\n\nPlease complete a short survey and return the monitor by today.\n\nBest,\nPAS 2.0 Team','\n',char(10)));
